import React,{ useState } from 'react';


const List=({todos})=>{

    return(
        <React.Fragment>
           {
               todos.map((ite,ind)=>(
                   <li style={{textDecoration:ite.status==="completed"?"underline":"none"}}>
                       <a href="/todos/todoitem">
                       {ite.name}
                        </a>
                    </li>
               ))
           }
        </React.Fragment>
    )

}


export default List;
